import React, { useState } from 'react';

const App = (props) => {
    const [clients, setClients] = useState([
        { id: 1, nom: "Marco RAKOTOBE" },
        { id: 2, nom: "Mercia RAKOTOBE" },
        { id: 3, nom: "BOB RABE" },
        { id: 4, nom: "Dada Rabe" },
        { id: 5, nom: "dadju" }

    ])
    return (
        <div>
            <p>{clients.map((client) => <li>{client.nom}</li>)}</p>

        </div >
    );
};

export default App;
